webpackJsonp([0xffe6ebc068a3],{579:function(e,s){e.exports={data:{site:{siteMetadata:{startDate:"2018-06-06",lessons:8,noClass:[4]}},markdownRemark:{html:'<h2>Class web site</h2>\n<p><a href="http://html.svahtml.com">http://html.svahtml.com</a></p>\n<p>All class work, materials, and assignments will be given though the class web site. In addition any announcement may be made on the site. The site will also provide back lesson and class presentations will be found there for you toreview.</p>\n<h2>Login for labcomputers</h2>\n<div class="gatsby-highlight" data-language="html">\n      <pre class="language-html"><code class="language-html">Username : svanyc\nPassword : svanyc</code></pre>\n      </div>\n<h2>Attendance</h2>\n<p>Every class is very important and will build off of the class before; therefore you must attend class every week. If you do miss a class, you are expected to make up the work before the next class. If you know in advance that you will miss a class, please contact me 24 hours before theclass.</p>\n<h2>Purpose of class</h2>\n<p>This is a hands-on course that will use HTML in new and complex ways. The course will begin with an overview of the Internet and how it functions creatively and as a utility. Students will write HTML and learn how to format text, incorporate images, build tables, create links, host and upload a Web site and utilize JavaScript. Students will design and implement their own websites or enhance an existing one, as well as participate in design discussions and critiques of student and professionalwork.</p>\n<h2>Syllabus</h2>',frontmatter:{lesson:null,title:"",lessonId:null,downloads:null}},allMarkdownRemark:{edges:[{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/files/ascii.md absPath of file >>> MarkdownRemark",frontmatter:{title:"",lesson:null},fields:{slug:"/files/ascii.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/files/syllabus.md absPath of file >>> MarkdownRemark",frontmatter:{title:"",lesson:null},fields:{slug:"/files/syllabus.html"}}}]}},pathContext:{slug:"/files/syllabus.html",title:""}}}});
